import React, {Component} from 'react';

export default class TeamList extends Component {

    constructor(props) {
        super();

        state = {
            teamName : "",
            // depending on the teamName, the teamMembers will be
            // injected accordingly
            teamMembers : []
        }
    }

    raTeamMembers = {

        harrison : {
            id : 1,
            name : "Harrison Newman",
            img : "/images/harrison-newman-profile-pic.jpg",

        },
        david : {
            id : 2,
            name : "David Walker",
            img : "/images/david-walker-profile-pic.jpg",
        },
        emily : {
            id : 3,
            name : "Emily Clubb",
            img : "images/emily-profile.jpeg",
        }
    }

    render() {

        return(
            <div>
                <h1 id="title">Resident Assistants</h1>
                {
                    this.state.teamMembers.map( member =>
                        <div className="">
                            <h1>Harrison Newman</h1>
                            <img src="/images/harrison-newman-profile-pic.jpg" alt="harrison-newman-profile-pic" id="harrison" />
                            <a className="link-text"  href="/harrison_newman"><h3>Meet Harrison</h3></a>
		                </div>

                    )
                }

        		<div class="container clearfix">
            		<div class="harrison-newman profile">
                		<h1>Harrison Newman</h1>
		                <img src="/images/harrison-newman-profile-pic.jpg" alt="harrison-newman-profile-pic" id="harrison" />
		                <a class="link-text"  href="/harrison_newman"><h3>Meet Harrison</h3></a>
		            </div>
		            <div class="david-walker profile">
		                <h1>David Walker</h1>
		                <img src="/images/david-walker-profile-pic.jpg" alt="david-walker-profile-pic" />
		                <a class="link-text"  href="/david_walker"><h3>Meet David</h3></a>
		            </div>
		            <div class="emily-clubb profile">
		                <h1>Emily Clubb</h1>
		                <img src="/images/emily-profile.jpeg" alt="emily-clubb-profile" id="emily" />
		                <a class="link-text" href="/emily_clubb"><h3>Meet Emily</h3></a>
		            </div>
		        </div>

            </div>
        ); 
    }
}
